import React from 'react';
import './App.css';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        {
          name: "Frankenstein",
          id: "one"
        },
        {
          name: "Zombie",
          id: "two"
        },
        {
          name: "Zigbie",
          id: "one"
        }
      ]
    }
  }

  render() {
    return (
      <div>
        {this.state.monsters.map(monster => <h1>{monster.name}</h1>)}
      </div>
    )
  }

}

export default App;
